import React from 'react';
import Card from './card';
import "../App.css"

const CardList = ({ data }) => {
  return (
    <div className="card-container border_all">
      {data.map((item, index) => (
        <Card key={index} title={item.title} content={item.content} />
      ))}
    </div>
  );
};

export default CardList;
